import { NavLink } from "react-router-dom";

const linkStyles = {
    display: "inline-block",
    width: "80px",
    padding: "12px",
    margin: "10px 6px 6px",
    textDecoration: "none",
    color: "black",

  };

function NavBar(){
    return(

         <nav>
            <NavLink to="/" exact style={linkStyles}
        activeStyle={{
          background: "#5d95cc",
        }} > <button> Home </button> </NavLink>
            <NavLink to="/Continent" exact> Continent </NavLink>
        </nav>
    )


}

export default NavBar;
